// src/pages/Reserve/Reserve.js
import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const Reserve = () => {
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('jwt');
    if (!token) {
      navigate('/login'); // Nếu không có token, chuyển hướng đến trang login
    }
  }, [navigate]);

  return (
    <div>
      <h1>Reserve Page</h1>
      {/* Nội dung trang Reserve */}
    </div>
  );
};

export default Reserve;
